CREATE FUNCTION public.clear_current_app_user() RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN
  PERFORM set_config('app.current_user_id', '', false);
END;
$$;
CREATE FUNCTION public.enforce_sys_admin_only() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  -- Allow if current user is sys admin
  IF is_sys_admin() THEN
    RETURN COALESCE(NEW, OLD);
  END IF;
  -- Block the operation for non-sys-admins
  RAISE EXCEPTION 'Access denied: Service table modifications require sys_admin privileges. Table: %, Operation: %',
    TG_TABLE_NAME, TG_OP
    USING ERRCODE = 'insufficient_privilege';
END;
$$;
CREATE FUNCTION public.is_sys_admin() RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  current_app_user TEXT;
  is_admin BOOLEAN := FALSE;
BEGIN
  -- Get the current application user from session variable
  current_app_user := current_setting('app.current_user_id', true);
  -- If no app user is set, allow the operation (for migrations and system operations)
  IF current_app_user IS NULL OR current_app_user = '' THEN
    RETURN TRUE;
  END IF;
  -- Check if the user has sys admin privileges
  SELECT EXISTS(
    SELECT 1 FROM users
    WHERE id::text = current_app_user
    AND is_sysadmin = true
    AND is_active = true
  ) INTO is_admin;
  RETURN is_admin;
END;
$$;
CREATE FUNCTION public.set_current_app_user(user_id uuid) RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN
  PERFORM set_config('app.current_user_id', user_id::text, false);
END;
$$;
