CREATE VIEW public.v_hrms_enhancement_summary AS
 WITH source_stats AS (
         SELECT count(*) AS total_sources,
            count(*) FILTER (WHERE (ref_reference_sources.api_availability = true)) AS api_enabled_sources,
            count(*) FILTER (WHERE ((ref_reference_sources.geographic_scope)::text = 'Global'::text)) AS global_sources,
            count(*) FILTER (WHERE (ref_reference_sources.integration_complexity = 'enterprise'::public.integration_complexity_enum)) AS enterprise_sources,
            avg(ref_reference_sources.reliability_score) AS avg_reliability_score,
            avg(ref_reference_sources.coverage_score) AS avg_coverage_score,
            sum(ref_reference_sources.skill_count) AS total_skills_available
           FROM public.ref_reference_sources
          WHERE (ref_reference_sources.is_active = true)
        ), enhancement_metrics AS (
         SELECT ss.total_sources,
            ss.api_enabled_sources,
            ss.global_sources,
            ss.enterprise_sources,
            ss.avg_reliability_score,
            ss.avg_coverage_score,
            ss.total_skills_available,
            7 AS new_tables_created,
            'career_paths, learning_programs, market_data, succession_planning, skill_categories, international_occupation_mappings, international_skills_mappings'::text AS new_table_list
           FROM source_stats ss
        )
 SELECT 'AI-HRMS 2025 Database Enhancement Summary'::text AS title,
    total_sources AS total_data_sources,
    api_enabled_sources AS api_integrated_sources,
    global_sources AS global_coverage_sources,
    enterprise_sources AS enterprise_grade_sources,
    round(avg_reliability_score, 2) AS average_reliability_score,
    round(avg_coverage_score, 2) AS average_coverage_score,
    total_skills_available AS total_skills_catalog_size,
    new_tables_created AS career_development_tables_added,
    new_table_list AS new_functionality_areas,
    'International Standards: ISCO-08, SOC-2018, ESCO, ISCED-2011'::text AS standards_compliance,
    '25+ European Languages + English'::text AS multilingual_support,
    'Real-time API Integration + Data Versioning'::text AS data_management_features,
    CURRENT_TIMESTAMP AS enhancement_completed_at
   FROM enhancement_metrics em;
CREATE VIEW public.v_migration_impact_summary AS
 SELECT 'Database Enhancement Impact Report'::text AS report_title,
    '✅ PHASE 1: Added 10 Missing Critical Sources'::text AS phase_1_status,
    '📊 Enhanced with O*NET, Skills Engine, Career Builder, LinkedIn, Indeed, Glassdoor, PayScale, Salary.com, BurningGlass, Lightcast'::text AS phase_1_details,
