CREATE VIEW public.v_service_data_sources AS
 SELECT 'skills_master'::text AS table_name,
    sm.skill_id AS record_id,
    sm.skill_name AS record_name,
    sm.source_key,
    rs.name_en AS source_name,
    rs.geographic_scope,
    rs.field_of_application,
    rs.reliability_score,
    sm.data_confidence_score,
    sm.last_verified_date,
    sm.is_system_managed,
    sm.created_at,
    sm.updated_at
   FROM (public.skl_skills_master sm
     LEFT JOIN public.ref_reference_sources rs ON (((sm.source_key)::text = (rs.source_key)::text)))
UNION ALL
 SELECT 'job_roles'::text AS table_name,
    jr.role_id AS record_id,
    jr.role_title AS record_name,
    jr.source_key,
    rs.name_en AS source_name,
    rs.geographic_scope,
    rs.field_of_application,
    rs.reliability_score,
    jr.data_confidence_score,
    jr.last_verified_date,
    jr.is_system_managed,
    jr.created_at,
    jr.updated_at
   FROM (public.job_job_roles jr
     LEFT JOIN public.ref_reference_sources rs ON (((jr.source_key)::text = (rs.source_key)::text)))
UNION ALL
 SELECT 'job_families'::text AS table_name,
    jf.family_id AS record_id,
    jf.family_name AS record_name,
    jf.source_key,
    rs.name_en AS source_name,
    rs.geographic_scope,
    rs.field_of_application,
    rs.reliability_score,
    jf.data_confidence_score,
    jf.last_verified_date,
    jf.is_system_managed,
    jf.created_at,
    jf.updated_at
   FROM (public.job_job_families jf
     LEFT JOIN public.ref_reference_sources rs ON (((jf.source_key)::text = (rs.source_key)::text)));
CREATE VIEW public.v_skills_analytics AS
 SELECT sm.skill_id,
    sm.skill_name,
    sm.skill_description,
    sm.skill_type,
    sm.skill_level,
    sm.transferability_score,
    sm.automation_risk_score,
    sm.future_demand_trend,
    sm.market_demand_score,
    sm.salary_premium_percentage,
    sm.is_emerging,
    rs.name_en AS source_name,
    rs.reliability_score AS source_reliability,
        CASE
            WHEN (sm.market_demand_score >= (8)::numeric) THEN 'High Demand'::text
            WHEN (sm.market_demand_score >= (6)::numeric) THEN 'Medium Demand'::text
            WHEN (sm.market_demand_score >= (4)::numeric) THEN 'Low Demand'::text
            ELSE 'Very Low Demand'::text
        END AS demand_level,
        CASE
            WHEN (sm.automation_risk_score <= (3)::numeric) THEN 'Low Risk'::text
            WHEN (sm.automation_risk_score <= (6)::numeric) THEN 'Medium Risk'::text
            WHEN (sm.automation_risk_score <= (8)::numeric) THEN 'High Risk'::text
            ELSE 'Very High Risk'::text
        END AS automation_risk_level,
    sm.created_at,
    sm.updated_at
   FROM (public.skl_skills_master sm
     LEFT JOIN public.ref_reference_sources rs ON (((sm.source_key)::text = (rs.source_key)::text)));
CREATE VIEW public.v_source_quality_dashboard AS
 SELECT source_key,
    name_en AS source_name,
    geographic_scope,
    field_of_application,
    organization_type,
    reliability_score,
    coverage_score,
    api_availability,
    update_frequency,
    skill_count,
    integration_complexity,
        CASE
            WHEN (last_updated > (CURRENT_DATE - '30 days'::interval)) THEN 'Fresh'::text
            WHEN (last_updated > (CURRENT_DATE - '90 days'::interval)) THEN 'Recent'::text
            WHEN (last_updated > (CURRENT_DATE - '365 days'::interval)) THEN 'Stale'::text
            ELSE 'Very Stale'::text
        END AS data_freshness,
    ( SELECT count(*) AS count
           FROM public.skl_skills_master sm
          WHERE ((sm.source_key)::text = (rs.source_key)::text)) AS skills_count,
    ( SELECT count(*) AS count
           FROM public.job_job_roles jr
          WHERE ((jr.source_key)::text = (rs.source_key)::text)) AS roles_count,
    ( SELECT count(*) AS count
           FROM public.job_job_families jf
          WHERE ((jf.source_key)::text = (rs.source_key)::text)) AS families_count,
    created_at,
    updated_at
   FROM public.ref_reference_sources rs
  WHERE (is_active = true)
  ORDER BY reliability_score DESC;
